import { useEffect , useState, useContext} from "react"
import Child from "./child"
import MyContext, { secondContext } from "./context"


export default function Parent(){
    const {contextState, setContextState} = useContext(MyContext);
    const {second, setSecondState} = useContext(secondContext);
    const [state, setState] = useState([1,2])

    useEffect(()=>{console.log('parent rerender')})
    function handleChild(state,message){
        setState(state)
        console.log(message)
    }
    return (
        <div>
            <h1>I am Parent  with state - {JSON.stringify(state)}</h1>

            <h2>Context Value from Parent is : {contextState}</h2>
            <h2>Second Value from Parent is : {second}</h2>

            <button onClick={()=> setState([... state])}>Parent state</button>
            <Child arg={handleChild}/>
        </div>
    )
}
